import React, { Component } from "react";
import GenNavBar from "./GenNavBar";
import HeaderImages from "../images/header/HeaderImages";
import Grid from "@material-ui/core/Grid";
import HeaderContent from "./HeaderContent";
import "../../../../index.css";

class HomePage extends Component {
  signInNav = () => {
    this.props.history.push("/signin");
  };

  signUpNav = () => {
    this.props.history.push("/signup");
  };

  render() {
    return (
      <div>
        <Grid
          container
          style={{
            background: "transparent",
          }}
        >
          <Grid item xs={12}>
            <GenNavBar
              signInNav={this.signInNav}
              signUpNav={this.signUpNav}
            ></GenNavBar>
          </Grid>
          <Grid
            item
            xs={12}
            style={{
              height: "57rem",
              background: "transparent",
              border: "1px soild red",
            }}
          >
            <HeaderContent></HeaderContent>
          </Grid>

          <Grid
            item
            xs={6}
            style={{
              border: "1px solid red",
              paddingLeft: "2rem",
              paddingTop: "4rem",
              paddingRight: "2rem",
            }}
          >
            <h2
              style={{
                fontSize: "52px",
                fontFamily: "Manrope",
                color: "#2a6bf4",
              }}
            >
              Be cognizient about your money
            </h2>
            <h4
              style={{
                fontSize: "20px",
                fontFamily: "Manrope",
                fontWeight: 200,
              }}
            >
              Take definite steps now to make your goals pragmatic. My Portolio
              Home give you a diverse range of options to enter your inflow and
              outflow of your funds.
            </h4>
          </Grid>
          <Grid
            item
            xs={6}
            style={{ border: "1px solid red", paddingLeft: "5rem" }}
          >
            <HeaderImages image={"1"}></HeaderImages>
          </Grid>
          <Grid
            item
            xs={6}
            style={{ border: "1px solid red", paddingLeft: "5rem" }}
          >
            <HeaderImages image={"2"}></HeaderImages>
          </Grid>
          <Grid
            item
            xs={6}
            style={{
              border: "1px solid red",
              paddingLeft: "2rem",
              paddingTop: "6rem",
              paddingRight: "2rem",
            }}
          >
            <h2
              style={{
                fontSize: "52px",
                fontFamily: "Manrope",
                color: "#2a6bf4",
              }}
            >
              Proactively set your life goals
            </h2>
            <h4
              style={{
                fontSize: "20px",
                fontFamily: "Manrope",
                fontWeight: 200,
              }}
            >
              Dreams thrive our lives. Don't let dreams go in vain wihtout
              proper planning and execution. We provide an opportunity for you
              to place your plan in action.
            </h4>
          </Grid>
          <Grid
            item
            xs={6}
            style={{
              border: "1px solid red",
              paddingLeft: "2rem",
              paddingTop: "12rem",
              paddingRight: "2rem",
            }}
          >
            <h2
              style={{
                fontSize: "52px",
                fontFamily: "Manrope",
                color: "#2a6bf4",
              }}
            >
              Be cognizient about your money
            </h2>
            <h4
              style={{
                fontSize: "20px",
                fontFamily: "Manrope",
                fontWeight: 200,
              }}
            >
              Plan your financial goals. Manage your investments and
              liabilities. With My Portfolio Home you can plan your short-term
              and long-term financial goals in a hassle free and realistic
              manner.
            </h4>
          </Grid>
          <Grid
            item
            xs={6}
            style={{ border: "1px solid red", paddingLeft: "5rem" }}
          >
            <HeaderImages image={"3"}></HeaderImages>
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default HomePage;
